@prefix : <http://www.semanticweb.org/ontology#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:Platform rdf:type owl:Class .
:Email rdf:type owl:Class .
:OrderConfirmationEmail rdf:type owl:Class ;
                      rdfs:subClassOf :Email .

:Purchase rdf:type owl:Class .
:hasPurchase rdf:type owl:ObjectProperty ;
             rdfs:domain :Platform ;
             rdfs:range :Purchase .

:hasConfirmationEmail rdf:type owl:ObjectProperty ;
                      rdfs:domain :Purchase ;
                      rdfs:range :OrderConfirmationEmail .

:withinFiveMinutes rdf:type owl:DatatypeProperty ;
                   rdfs:domain :OrderConfirmationEmail ;
                   rdfs:range xsd:boolean .
